import React from 'react'
import  {Link} from 'react-router-dom'
const HomePage = () => {
  return (
    <div>
        <h1>Welcome</h1>
      <Link className=" link" to="/"><button>Logout</button></Link>
    </div>
  )
}

export default HomePage
